import React from 'react';
import { useDispatch } from 'react-redux';
import fixed from '../../Functions/fixed';
import * as actions from '../../Store/actions';

function Coin({ task }) {
  const {
    name, count, priceUsd, totalpriceUsd, key,
  } = task;

  const dispatch = useDispatch();

  return (
    <div className="coin" id={key}>
      <div className="coin__purchase-info">
        {name}
      </div>
      <div className="coin__purchase-info">
        {count}
      </div>
      <div className="coin__purchase-info">
        $
        {fixed(priceUsd)}
      </div>
      <div className="coin__purchase-info">
        $
        {fixed(totalpriceUsd)}
      </div>
      <div className="coin__purchase-info">
        <button className="form-button form-button--color--red" onClick={() => dispatch(actions.removeCoin(key))} tabIndex={0} onKeyDown={() => dispatch(actions.removeCoin(key))}>Remove</button>
      </div>
    </div>

  );
}

export default Coin;
